import React from 'react'
import { MapContainer,  TileLayer } from "react-leaflet";
import "./Map.css";
function map() {
    return (
        <div className = "map">
            <Map>
                <TileLayer 
                    url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                    attribution='&copy; <a href = "https://osm.org/copyright">OpenStreetMap</a contributors'
                />
            </Map>
        </div>
    );
}
export default map;
